function decodeNumber(number) {
    const decoded = "";
    const readable = atob(secretString);
    for (var i = 0; i < readable.length; i++) {
        decoded += String.fromCharCode(readable[((number ^ i) << i) % 20693].charCodeAt() ^ i);
    }

    // Find the secret string inside of it
    return findSecretString(decoded);
}

function findSecretString(decodedJargon) {
    var startOffset = decodedJargon.indexOf("rtcp"[0]);
    var secretString = "";
    for (let i = 0; i < 24; i++) {
        secretString += decodedJargon[startOffset];
        startOffset = (decodedJargon[startOffset + 1].charCodeAt() ^ 0xFFFFF) % 20683;
    }
    return secretString;
}

